                        new
                        {
                            Id = 1086,
                            Annee = 2020,
                            IdActivite = 774,
                            IdMesure = 245,
                            Nom = " تتبع التقدم المحقق في تنزيل البرنامج الوطني التنفيذي للسياسة العمومية المندمجة لحماية الطفولة: • أربع عقد اجتماعات خلال الفترة من 25 يناير 2017إلى 14 دجنبر 2018، وإعداد تقارير دورية حول حصيلة منجزات البرنامج الوطني التنفيذي.•إحداث البوابة المعلوماتية مرصد الخاصة بالتبليغ وتتبع جميع حالات العنف بالوسط المدرسي؛ سنة إحداث البوابة وعدد المبلغين في كل سنة؟  •إعداد نظام معلوماتي خاص بتتبع الأطفال المودعين بمراكز حماية الطفولة من طرف السلطات القضائية (سنة إعداد النظام وعدد المودعين حسب السنوات؟) ، مع توفير قاعدة معلومات محينة حول وضعية الأطفال والفضاءات والمرافق والحاجيات الحقيقية لمراكز حماية الطفولة؛ •وضع منظومة «مسار للتتبع الفردي لكل التلميذات والتلاميذ؛•مراجعة المنظومة المعلوماتية المتعلقة ببرامج صحة الأم والطفل والتنظيم العائلي والعلاجات الأساسية وفق الأولويات الجديدة لوزارة الصحة فيما يخص صحة الطفل؛ •تطوير البرنامج الإحصائي على صعيد وزارة التربية الوطنية والتكوين المهني والتعليم العالي والبحث العلمي ؛",
